import React, { Component } from "react"

function update(state) {
    // console.log(document.getElementById("newURI").value);
    console.log(state.contract.methods.owner().call()).resolve();
}

function ChangeURI(props) {
    if (props.owner == true){
        return(
            <div>
                <input id = "newURI" type="text"></input>
                <a href = "#" onClick={update(props.this.state)}>update</a>
            </div>
        );
    }
    else {
        return (<></>);
    }

}

export default ChangeURI;
